import React, { useState, useEffect } from 'react';
import { Toast } from 'react-bootstrap';
import axios from 'axios';
import { Link } from 'react-router-dom';


const Home = () => {

    const [jokes, setJokes] = useState({});


    useEffect(() => {
        axios.get('http://localhost:3000/jokes')
            .then(res => {
                console.log(res);
                setJokes(res.data);

            })
    }, [])
    const jokeList = jokes.length ? (
        jokes.map(joke => {
            return (

                <div className="container" key={joke.id}>

                    <div className="content text-center">
                        <Link to={'/' + joke._id}>
                            <h4 className="card-title red-text">{joke.title}</h4>
                        </Link>

                    </div>
                </div>

            )
        })
    ) : (
            <div className="center">Ingen jokes at vise</div>
        );


    return (

        <div className="container">
            <h1 className="text-center mt-5">Sjove Jokes</h1>
            <p className="text-center">Platte jokes, sjove jokes og meget mere...</p>
            <div className="jumbotron">
            </div>

            <div className="container">

                <div className="row">
                    <div className="col-6">
                        <Toast>
                            <Toast.Header>
                                <img src="holder.js/20x20?text=%20" className="rounded mr-2" alt="" />
                                <strong className="mr-auto">Bootstrap</strong>
                                <small>11 mins ago</small>
                            </Toast.Header>
                            <Toast.Body>Hello, world! This is a toast message.</Toast.Body>
                        </Toast>

                        <Toast>
                            <Toast.Header>
                                <img src="holder.js/20x20?text=%20" className="rounded mr-2" alt="" />
                                <strong className="mr-auto">Bootstrap</strong>
                                <small>11 mins ago</small>
                            </Toast.Header>
                            <Toast.Body>Hello, world! This is a toast message.</Toast.Body>
                        </Toast>




                    </div>


                </div>
            </div>

            {/* {jokeList} */}
        </div>



    )
}

export default Home;
